// Cấu hình I2C
#define I2C_MASTER_SCL_IO 13    // Chân SCL
#define I2C_MASTER_SDA_IO 12    // Chân SDA
#define I2C_MASTER_FREQ_HZ 100000
#define I2C_MASTER_NUM I2C_NUM_0
#define LCD_ADDR 0x27           // Địa chỉ I2C LCD (0x27 hoặc 0x3F)

// Thông tin SMBus và LCD
smbus_info_t *smbus_info;
i2c_lcd1602_info_t *lcd;

// Định nghĩa tag log
static const char *TAG = "ESP32-CAM-AI";

// Hàm khởi tạo giao tiếp I2C
void i2c_master_init() {
    i2c_config_t conf = {
        .mode = I2C_MODE_MASTER,
        .sda_io_num = I2C_MASTER_SDA_IO,
        .sda_pullup_en = GPIO_PULLUP_ENABLE,
        .scl_io_num = I2C_MASTER_SCL_IO,
        .scl_pullup_en = GPIO_PULLUP_ENABLE,
        .master.clk_speed = I2C_MASTER_FREQ_HZ,
    };
    i2c_param_config(I2C_MASTER_NUM, &conf);
    i2c_driver_install(I2C_MASTER_NUM, conf.mode, 0, 0, 0);
}

// Hàm khởi tạo LCD
void lcd_init() {
    // Cấp phát bộ nhớ cho SMBus
    smbus_info = smbus_malloc();
    if (!smbus_info) {
        ESP_LOGE(TAG, "Không thể cấp phát bộ nhớ cho SMBus");
        return;
    }

    // Khởi tạo SMBus
    smbus_init(smbus_info, I2C_MASTER_NUM, LCD_ADDR);
    smbus_set_timeout(smbus_info, 1000 / portTICK_PERIOD_MS);

    // Cấp phát bộ nhớ cho LCD
    lcd = i2c_lcd1602_malloc();
    if (!lcd) {
        ESP_LOGE(TAG, "Không thể cấp phát bộ nhớ cho LCD");
        return;
    }

    // Khởi tạo LCD
    if (i2c_lcd1602_init(lcd, smbus_info, true, 2, 16, 16) != ESP_OK) {
        ESP_LOGE(TAG, "Khởi tạo LCD thất bại");
        return;
    }

    i2c_lcd1602_reset(lcd);
    i2c_lcd1602_set_backlight(lcd, true);
    i2c_lcd1602_clear(lcd);
    i2c_lcd1602_home(lcd);
    i2c_lcd1602_write_string(lcd, "Initializing...");
    vTaskDelay(pdMS_TO_TICKS(500));
}

