// Hàm khởi tạo bộ nhớ trong PSRAM
bool allocate_memory() {
    input_image = (float *)heap_caps_malloc(INPUT_WIDTH * INPUT_HEIGHT * INPUT_CHANNELS * sizeof(float), MALLOC_CAP_SPIRAM);
    conv1_output = (float *)heap_caps_malloc(CONV1_OUT_CHANNELS * INPUT_WIDTH * INPUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    pool1_output = (float *)heap_caps_malloc(CONV1_OUT_CHANNELS * POOL1_OUT_WIDTH * POOL1_OUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    conv2_output = (float *)heap_caps_malloc(CONV2_OUT_CHANNELS * POOL1_OUT_WIDTH * POOL1_OUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    pool2_output = (float *)heap_caps_malloc(CONV2_OUT_CHANNELS * POOL2_OUT_WIDTH * POOL2_OUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    fc1_output = (float *)heap_caps_malloc(FC1_OUT_SIZE * sizeof(float), MALLOC_CAP_SPIRAM);
    fc2_output = (float *)heap_caps_malloc(FC2_OUT_SIZE * sizeof(float), MALLOC_CAP_SPIRAM);
    fc3_output = (float *)heap_caps_malloc(NUM_CLASSES * sizeof(float), MALLOC_CAP_SPIRAM);

    if (!input_image || !conv1_output || !pool1_output || !conv2_output || !pool2_output || !fc1_output || !fc2_output || !fc3_output) {
        ESP_LOGE(TAG, "Không thể khởi tạo bộ nhớ trong PSRAM.");
        return false;
    }

    ESP_LOGI(TAG, "Khởi tạo bộ nhớ trong PSRAM thành công.");
    return true;
}


// Hàm resize (nearest-neighbor interpolation)
void resize_image(uint8_t *input, int in_width, int in_height,
                  float *output, int out_width, int out_height) {
    float scale_x = (float)in_width / out_width;
    float scale_y = (float)in_height / out_height;

    for (int y = 0; y < out_height; y++) {
        for (int x = 0; x < out_width; x++) {
            int nearest_x = (int)(x * scale_x);
            int nearest_y = (int)(y * scale_y);

            for (int c = 0; c < INPUT_CHANNELS; c++) {
                output[(y * out_width + x) * INPUT_CHANNELS + c] =
                    (input[(nearest_y * in_width + nearest_x) * INPUT_CHANNELS + c] / 127.5f) - 1.0f;
            }
        }
    }
}

// Hàm Convolution
void conv2d(const float *input, const float *weights, const float *bias,
            float *output, int in_channels, int out_channels,
            int in_width, int in_height, int kernel_size, int stride, int padding) {
    int out_width = (in_width - kernel_size + 2 * padding) / stride + 1;
    int out_height = (in_height - kernel_size + 2 * padding) / stride + 1;

    for (int oc = 0; oc < out_channels; oc++) {
        for (int oh = 0; oh < out_height; oh++) {
            for (int ow = 0; ow < out_width; ow++) {
                float sum = bias[oc];
                for (int ic = 0; ic < in_channels; ic++) {
                    for (int kh = 0; kh < kernel_size; kh++) {
                        for (int kw = 0; kw < kernel_size; kw++) {
                            int ih = oh * stride + kh - padding;
                            int iw = ow * stride + kw - padding;
                            if (ih >= 0 && ih < in_height && iw >= 0 && iw < in_width) {
                                sum += input[(ic * in_height + ih) * in_width + iw] *
                                       weights[((oc * in_channels + ic) * kernel_size + kh) * kernel_size + kw];
                            }
                        }
                    }
                }
                output[(oc * out_height + oh) * out_width + ow] = sum;
            }
        }
    }
}

// Hàm MaxPooling, Fully Connected, ReLU, Softmax và pipeline xử lý ảnh tương tự như trước.
// Hàm MaxPooling
void maxpool2d(const float *input, float *output,
               int in_channels, int in_width, int in_height,
               int pool_size, int stride) {
    int out_width = (in_width - pool_size) / stride + 1;
    int out_height = (in_height - pool_size) / stride + 1;

    for (int c = 0; c < in_channels; c++) {
        for (int oh = 0; oh < out_height; oh++) {
            for (int ow = 0; ow < out_width; ow++) {
                float max_val = -INFINITY;

                for (int ph = 0; ph < pool_size; ph++) {
                    for (int pw = 0; pw < pool_size; pw++) {
                        int ih = oh * stride + ph;
                        int iw = ow * stride + pw;

                        if (ih < in_height && iw < in_width) {
                            float val = input[(c * in_height + ih) * in_width + iw];
                            if (val > max_val) {
                                max_val = val;
                            }
                        }
                    }
                }
                output[(c * out_height + oh) * out_width + ow] = max_val;
            }
        }
    }
}

// Hàm Fully Connected
void fully_connected(const float *input, const float *weights, const float *bias,
                     float *output, int input_size, int output_size) {
    for (int o = 0; o < output_size; o++) {
        float sum = bias[o];
        for (int i = 0; i < input_size; i++) {
            sum += input[i] * weights[o * input_size + i];
        }
        output[o] = sum;
    }
}

// Hàm ReLU
void relu(float *data, int size) {
    for (int i = 0; i < size; i++) {
        if (data[i] < 0) {
            data[i] = 0;
        }
    }
}

// Hàm Softmax
void softmax(float *data, int size) {
    float max_val = -INFINITY;
    for (int i = 0; i < size; i++) {
        if (data[i] > max_val) {
            max_val = data[i];
        }
    }

    float sum = 0.0;
    for (int i = 0; i < size; i++) {
        data[i] = expf(data[i] - max_val);
        sum += data[i];
    }

    for (int i = 0; i < size; i++) {
        data[i] /= sum;
    }
}

// Pipeline xử lý
void process_image() {
    // Conv1
    conv2d(input_image, weight_conv1_weight, weight_conv1_bias, conv1_output,
           INPUT_CHANNELS, CONV1_OUT_CHANNELS, INPUT_WIDTH, INPUT_HEIGHT, 5, 1, 2);
    relu(conv1_output, CONV1_OUT_CHANNELS * INPUT_WIDTH * INPUT_HEIGHT);

    // Pool1
    maxpool2d(conv1_output, pool1_output, CONV1_OUT_CHANNELS, INPUT_WIDTH, INPUT_HEIGHT, 2, 2);

    // Conv2
    conv2d(pool1_output, weight_conv2_weight, weight_conv2_bias, conv2_output,
           CONV1_OUT_CHANNELS, CONV2_OUT_CHANNELS, POOL1_OUT_WIDTH, POOL1_OUT_HEIGHT, 5, 1, 0);
    relu(conv2_output, CONV2_OUT_CHANNELS * POOL1_OUT_WIDTH * POOL1_OUT_HEIGHT);

    // Pool2
    maxpool2d(conv2_output, pool2_output, CONV2_OUT_CHANNELS, POOL1_OUT_WIDTH, POOL1_OUT_HEIGHT, 2, 2);

    // Flatten và Fully Connected
    fully_connected(pool2_output, weight_fc1_weight, weight_fc1_bias, fc1_output,
                    CONV2_OUT_CHANNELS * POOL2_OUT_WIDTH * POOL2_OUT_HEIGHT, FC1_OUT_SIZE);
    relu(fc1_output, FC1_OUT_SIZE);

    fully_connected(fc1_output, weight_fc2_weight, weight_fc2_bias, fc2_output, FC1_OUT_SIZE, FC2_OUT_SIZE);
    relu(fc2_output, FC2_OUT_SIZE);

    fully_connected(fc2_output, weight_fc3_weight, weight_fc3_bias, fc3_output, FC2_OUT_SIZE, NUM_CLASSES);
    softmax(fc3_output, NUM_CLASSES);

    // Kết quả phân loại
    int max_class = 0;
    for (int i = 1; i < NUM_CLASSES; i++) {
        if (fc3_output[i] > fc3_output[max_class]) {
            max_class = i;
        }
    }
    ESP_LOGI(TAG, "Phân loại: %s (%.2f%%)", class_names[max_class], fc3_output[max_class] * 100);

    // Hiển thị kết quả lên LCD
        i2c_lcd1602_clear(lcd);
        i2c_lcd1602_move_cursor(lcd, 0, 0);
        i2c_lcd1602_write_string(lcd, "KQ:");
        i2c_lcd1602_write_string(lcd, class_names[max_class]);
}

