// Main loop
void app_main() {
    // Khởi tạo I2C và LCD
    i2c_master_init();
    lcd_init();

    //Khởi tạo bộ nhớ PSRAM cho các mảng lớn
    input_image = (float *)heap_caps_malloc(INPUT_WIDTH * INPUT_HEIGHT * INPUT_CHANNELS * sizeof(float), MALLOC_CAP_SPIRAM);
    conv1_output = (float *)heap_caps_malloc(CONV1_OUT_CHANNELS * INPUT_WIDTH * INPUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    pool1_output = (float *)heap_caps_malloc(CONV1_OUT_CHANNELS * POOL1_OUT_WIDTH * POOL1_OUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    conv2_output = (float *)heap_caps_malloc(CONV2_OUT_CHANNELS * POOL1_OUT_WIDTH * POOL1_OUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    pool2_output = (float *)heap_caps_malloc(CONV2_OUT_CHANNELS * POOL2_OUT_WIDTH * POOL2_OUT_HEIGHT * sizeof(float), MALLOC_CAP_SPIRAM);
    fc1_output = (float *)heap_caps_malloc(FC1_OUT_SIZE * sizeof(float), MALLOC_CAP_SPIRAM);
    fc2_output = (float *)heap_caps_malloc(FC2_OUT_SIZE * sizeof(float), MALLOC_CAP_SPIRAM);
    fc3_output = (float *)heap_caps_malloc(NUM_CLASSES * sizeof(float), MALLOC_CAP_SPIRAM);
    
    if (!input_image || !conv1_output || !pool1_output || !conv2_output ||
        !pool2_output || !fc1_output || !fc2_output || !fc3_output) {
        ESP_LOGE(TAG, "Không thể cấp phát bộ nhớ PSRAM!");
        return;
    }
    
    // Khởi tạo camera
    if (app_camera_init() != 0) {
        ESP_LOGE(TAG, "Camera initialization failed.");
        return;
    }
    ESP_LOGI(TAG, "Camera initialized successfully.");
    // Kiểm tra bộ nhớ sau mỗi lần xử lý ảnh
    check_memory();
    // Vòng lặp chính
    // TickType_t start, end;

    while (1) {
        //start = xTaskGetTickCount();
        camera_fb_t *fb = esp_camera_fb_get();
        //end = xTaskGetTickCount();
        // ESP_LOGI(TAG, "Time to capture frame: %d ms", (end - start) * portTICK_PERIOD_MS);

        if (!fb) {
            ESP_LOGE(TAG, "Không thể chụp ảnh!");
            vTaskDelay(pdMS_TO_TICKS(3000));
            continue;
        }

        // In ra thông báo khi ảnh được chụp và kích thước ảnh
        ESP_LOGI(TAG, "Đã chụp ảnh! Kích thước ảnh: %d x %d", fb->width, fb->height);
        //ESP_LOGI(TAG, "Time to capture frame: %d ms", (end - start) * portTICK_PERIOD_MS);

        //xử lý ảnh
        resize_image(fb->buf, fb->width, fb->height, input_image, INPUT_WIDTH, INPUT_HEIGHT);
        process_image();  // Gọi pipeline xử lý ảnh
        esp_camera_fb_return(fb); // Giải phóng frame buffer

        vTaskDelay(pdMS_TO_TICKS(3000));  // Chụp lại ảnh sau 10 giây

        // Kiểm tra bộ nhớ sau mỗi lần xử lý ảnh
        //check_memory();
    }
}

